package reactor;import java.io.Serializable;/** * Created by demopoo on 2017/8/29. */public class Person implements Serializable {    private String name;    private int age;    private String id;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public int getAge() {        return age;    }    public void setAge(int age) {        this.age = age;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    @Override    public String toString() {        return "Person{" +                "name='" + name + '\'' +                ", age=" + age +                ", id='" + id + '\'' +                '}';    }}